import React from 'react';
import {
    View,
    Text,
    StyleSheet
} from 'react-native';

export default function Balance() {
    return (
        <View style={styles.container}>
            <View style={styles.item}>
                <Text>Saldo</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#FFF',
    }
})
